import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Home from './pages/Home/Home';
import Error from './pages/Error/Error';

const App = () => {

  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/profile" exact>
          work in progress :)
        </Route>
        <Route path="*">
          <Error />
        </Route>
      </Switch>
    </Router>
  )
}

export default App;
